export const Demosecond = () => {
  return (
    <div className="">
      <section style={{display:'flex'}}>
        <div style={{flex:'0.5',margin:'auto',textAlign:'center'}}>Form1</div>
        <div style={{flex:'0.5'}}><LoginForm1/></div>
      </section>
      <section style={{display:'flex'}}>
        
        <div style={{flex:'0.5'}}><LoginForm2/></div>
        <div style={{flex:'0.5',margin:'auto',textAlign:'center'}}>Form1</div>
      </section>
      <LoginForm2/>
      <LoginForm3/>
      <LoginForm4/>
    </div>
  );
};
